import React, { useContext } from "react";
import { Link } from "react-router-dom";
import { AuthContext } from "../../context/AuthContext";

function Welcome() {
  const { user, logout } = useContext(AuthContext) || {};

  const handleLogout = () => {
    logout();
    window.location.href = "/";
  };

  const styles = {
    container: {
      minHeight: "100vh",
      background: "linear-gradient(135deg, #667eea 0%, #764ba2 100%)",
      padding: "20px",
      fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    },
    header: {
      display: "flex",
      justifyContent: "space-between",
      alignItems: "center",
      padding: "30px 40px",
      maxWidth: "1200px",
      margin: "0 auto",
    },
    nav: {
      display: "flex",
      gap: "15px",
    },
    button: {
      padding: "10px 20px",
      borderRadius: "8px",
      border: "none",
      fontWeight: "600",
      cursor: "pointer",
      transition: "all 0.3s ease",
      fontSize: "14px",
    },
    loginBtn: {
      padding: "10px 20px",
      borderRadius: "8px",
      border: "none",
      fontWeight: "600",
      cursor: "pointer",
      transition: "all 0.3s ease",
      fontSize: "14px",
      background: "white",
      color: "#667eea",
      marginRight: "10px",
    },
    loginBtnHover: {
      transform: "translateY(-2px)",
      boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
    },
    registerBtn: {
      padding: "10px 20px",
      borderRadius: "8px",
      border: "2px solid white",
      background: "transparent",
      color: "white",
      fontWeight: "600",
      cursor: "pointer",
      transition: "all 0.3s ease",
      fontSize: "14px",
    },
    heroSection: {
      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
      textAlign: "center",
      maxWidth: "800px",
      margin: "0 auto",
      paddingTop: "100px",
      color: "white",
    },
    title: {
      fontSize: "56px",
      fontWeight: "800",
      marginBottom: "20px",
      textShadow: "2px 2px 4px rgba(0,0,0,0.2)",
    },
    subtitle: {
      fontSize: "24px",
      fontWeight: "300",
      marginBottom: "40px",
      opacity: "0.95",
      lineHeight: "1.6",
    },
    ctaButton: {
      padding: "14px 40px",
      fontSize: "16px",
      fontWeight: "600",
      borderRadius: "50px",
      border: "none",
      background: "white",
      color: "#667eea",
      cursor: "pointer",
      transition: "all 0.3s ease",
      boxShadow: "0 6px 20px rgba(0,0,0,0.15)",
    },
  };

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h2 style={{ color: "white", fontSize: "24px", fontWeight: "700" }}>EventHub</h2>
        <nav style={styles.nav}>
          {!user && (
            <>
              <Link to="/login" style={{ textDecoration: "none" }}>
                <button
                  style={styles.loginBtn}
                  onMouseOver={(e) => {
                    e.target.style.transform = "translateY(-2px)";
                    e.target.style.boxShadow = "0 4px 12px rgba(0,0,0,0.15)";
                  }}
                  onMouseOut={(e) => {
                    e.target.style.transform = "translateY(0)";
                    e.target.style.boxShadow = "none";
                  }}
                >
                  Login
                </button>
              </Link>
              <Link to="/register" style={{ textDecoration: "none" }}>
                <button
                  style={styles.registerBtn}
                  onMouseOver={(e) => {
                    e.target.style.background = "white";
                    e.target.style.color = "#667eea";
                  }}
                  onMouseOut={(e) => {
                    e.target.style.background = "transparent";
                    e.target.style.color = "white";
                  }}
                >
                  Register
                </button>
              </Link>
            </>
          )}
          {user && (
            <>
              <Link to="/dashboard" style={{ textDecoration: "none" }}>
                <button style={styles.loginBtn}>Dashboard</button>
              </Link>
              <button style={styles.loginBtn} onClick={handleLogout}>
                Logout
              </button>
            </>
          )}
        </nav>
      </header>

      <section style={styles.heroSection}>
        <h1 style={styles.title}>Welcome to EventHub</h1>
        <p style={styles.subtitle}>
          Manage events, guests, tasks, expenses, and items all in one place. Organize your perfect event effortlessly!
        </p>
        {!user && (
          <Link to="/register" style={{ textDecoration: "none" }}>
            <button
              style={styles.ctaButton}
              onMouseOver={(e) => {
                e.target.transform = "translateY(-3px)";
                e.target.style.boxShadow = "0 8px 25px rgba(0,0,0,0.2)";
              }}
              onMouseOut={(e) => {
                e.target.style.boxShadow = "0 6px 20px rgba(0,0,0,0.15)";
              }}
            >
              Get Started
            </button>
          </Link>
        )}
      </section>
    </div>
  );
}

export default Welcome;
